import React, { Component } from 'react';
import introImage from '../images/intro-pic.jpg';

class IntroPage extends Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div class="row">
        <img src={introImage} class="col-12"></img>
      </div>
    )
  }

}

export default IntroPage;
